// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './Pages/Home';
import About from './Pages/About';
import Contact from './Pages/Contact';
import Sidebar from './sitemap/Sidebar';
import CheckboxesGroup from './ui/CheckboxesGroup';
import {
    TagFaces,
    Visibility,
    Fingerprint
} from '@mui/icons-material';
import Api from "./Pages/Api";
import './App.css'; // Add global styles

function App() {
    const pages = [
        { title: 'Home', path: '/' },
        { title: 'About', path: '/about' },
        { title: 'Contact', path: '/contact' },
        { title: 'CheckboxesGroup', path: '/CheckboxesGroup' },
/*        { title: 'Api', path: '/api' },*/
        // Add more pages here
    ];
    const biooption = [
        {
            name: "Face",
            id: "0",
            bool: false,
            icon: TagFaces,
        },
        {
            name: "Iris",
            id: "1",
            bool: false,
            icon: Visibility,
        },
        {
            name: "Finger",
            id: "2",
            bool: true,
            icon: Fingerprint,
        },
    ];
    return (
        <Router>
            <div className="app-container">
        {/*        <Api />*/}
                <Sidebar pages={pages} />
                <div className="main-content">
                    <h1>Welcome to My App</h1>
                    <nav>
                        <ul>
                            <li><Link to="/">Home</Link></li>
                            <li><Link to="/about">About</Link></li>
                            <li><Link to="/contact">Contact</Link></li>
                            <li><Link to="/CheckboxesGroup">CheckboxesGroup</Link></li>
                            {/*  <li><Api to="/api">Api</Api></li>*/}
                        </ul>
                    </nav>
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/about" element={<About />} />
                        <Route path="/contact" element={<Contact />} />
                        <Route path="/CheckboxesGroup" element={<CheckboxesGroup biooptions={biooption} />} />
   {/*                     <Route path="/api" element={<Api />} />*/}
                    </Routes>
                </div>
            </div>
        </Router>
    );
}

export default App;
